const sum = (a, b) => {
    // console.log(`thw sum is ${a + b}`)
    return a + b
}
const sub = (a, b) => {
    // console.log(`thw substraction is ${a - b}`)
    return a - b
}
const mul = (a, b) => {
    // console.log(`thw multiplication is ${a * b}`)
    return a * b
}
const div = (a, b) => {
    // console.log(`thw division is ${a / b}`)
